INSERT INTO page VALUES(0,'Alexander Shogenov - Full Stack Web Developer','Alexander Shogenov. Full-Stack Web-Developer: PHP, NodeJS, React','<h2><img src="data:image/jpeg;base64,"></h2><h2>Hello, I''m Full-Stack Web-Developer</h2><p>Phone: <a href="tel:89951999195" target="_blank">8-995-1-999-195</a></p><p>Email: <a href="mailto:alex@shogenov" target="_blank">alex@shogenov</a></p><p>My <strong>github</strong> account is <a href="https://github.com/shaggyrec" target="_blank">https://github.com/shaggyrec</a></p><h2>Experience</h2><h3>2018 - NOW <a href="https://xiag.ch" target="_blank">XIAG AG</a></h3><p>I work in project <a href="https://hogashop.ch" target="_blank">hogashop</a>.</p><p>I use the php and nodejs for different tasks on the server and react in the browser.</p><p>Hogashop is the big project consisting of the microservices. For example we have a separates module for api, each UI feature, import etc.</p><p>For deploy and configuration we use the salt stack. I write tests and follow the Test Driven Development. It''s a very important and useful experience. This application is very popular in the Switzerland. I like to develop something useful for people and something that make the everyday work of some people simplify.</p><h3>2018 - 2018 Law company <a href="https://edin.center" target="_blank">edin.center</a></h3><p>I developed the web-site of the company(include design). I implemented this site using the <a href="http://slimframework.com" target="_blank">slim framework</a>. News section on this site uses the server-side rendering with react. Some js-components implemented using the react. For example forms and interactive svg map.</p><p>I implemented the <a href="https://github.com/shaggyrec/js-css-compressor" target="_blank">js-css-compressor</a> for minification, transform and gzipping css and js files.</p><h3>2017 - 2018 Booking service <a href="https://edem-v-gosti.ru" target="_blank">edem-v-gosti.ru</a></h3><p>Don''t be scared when go to the this site. I didn''t do the main site (only some small fixes). I created the <a href="https://edem-v-gosti.ru/lk" target="_blank">account for hotels owners</a> using react, redux. I used the bitrix as api. It was very strange but main site written on the bitrix.</p><p>Account includes:</p><ul><li>the registration with not simple logic;</li><li>adding the hotel in the system</li><li>editing the hotel info</li><li>adding the information and types of rooms</li><li>price table with editing price by different time period</li><li>moderation and separate UI for moderators</li><li>Integration with CRM and making invoices</li></ul><h3>2016 - 2017 Web-studio <a href="http://web.archive.org/web/20180625145151/http://vuduteam.ru:80/" target="_blank">VuduTeam</a></h3><p>I developed the sites using different CMSs. All programmers(at some point in they life) want to develop own the best CMS. I try to do it in VuduTeam. I implemented working version of CMS but now I afraid to look the code of it. I created the photo-album constructor using js, canvas at this period. Now it is <a href="https://msl.su" target="_blank">msl.su</a>.</p><h3>2014 - 2016 Web-studio <a href="https://clickon.ru" target="_blank">Clickon</a></h3><p>My first job as programmer. I learned a new (for me) language <a href="http://parser.ru" target="_blank">parser</a>.</p><p>I developed the web-sites and web-application with different complexity. I''ve take the next level in PHP, HTML, CSS and JS.</p><p>For example I developed a nice site with some animations and interactive svg-maps <a href="http://dom-ekonom.info" target="_blank">dom-ekonom.info</a>.</p><p>____________</p><p>before 2014 Learning and beginning with building the simple <s>bad</s> apps for the web</p><p><br></p><h2>My key skills:</h2><p><img src="data:image/png;base64,"> <img src="data:image/png;base64,"> <img src="data:image/png;base64,"> <img src="data:image/png;base64,"></p><h3>PHP</h3><p>I use version 7 with a newest features. I like php for simplicity and power.</p><p>I sure that we don''t need the frameworks for each task. I like a pure PHP. With composer it is a very powerful.</p><p>In the specific cases I use <a href="http://www.slimframework.com" target="_blank">slim framework</a> and add the necessary libraries with the composer. You can see <a href="https://github.com/shaggyrec/slim-php-sqllite-boilerplate" target="_blank">my boilerplate for slim and sqlite3</a>.</p><h3>JS</h3><p>On the server and in the browser. I use new features but I don''t forget about transformation newest code to understandable for any browser.</p><p>For example I implemented the <a href="https://github.com/shaggyrec/js-css-compressor" target="_blank">js-css-compressor (https://github.com/shaggyrec/js-css-compressor)</a> for one of previous client.</p><h3>NodeJS</h3><p>NodeJS is very useful for services which works like a daemons.</p><p>And I made sites and api on the NodeJS too.</p><p>I took a little part in the fixing a bug in the open source project <a href="https://github.com/shaggyrec/xlsx-stream-reader" target="_blank" style="color: rgb(143, 203, 255);">xlsx stream reader</a> <a href="https://github.com/shaggyrec/xlsx-stream-reader" target="_blank">https://github.com/shaggyrec/xlsx-stream-reader</a>.</p><p>For NodeJS server I prefer the <a href="https://koajs.com" target="_blank">Koa framework</a>. It''s very simple and nice.</p><h3>React</h3><p>I use the React, Redux, Sagas for frontend. With React I can build a big complex interfaces, for example single-page application, and I can implement a small components for web-page insertions as a separate module. This site written using react and I want to put its source code it the github in the future(When I will made that I replace this part of text with link to the repo). I implemented the universal react web-app(SSR with reusing same react code on the client and on the server).</p><h3>Typescript</h3><p>I like Typescript because it''s guarantee a good code style and strict types for such liberal language as JavaScript. I can write a good readable code, use all newest features and use OOP when I write on the Typescript.</p><p>I have repo with a small example of code on Typescript using Koa and Mysql <a href="https://github.com/shaggyrec/koajs-mysql-api" target="_blank">https://github.com/shaggyrec/koajs-mysql-api</a></p><h3>Git</h3><p>It''s hard to imagine a modern development without a&nbsp;git. I know and use git-flow and semantic versioning.</p><h3>Test Driven Development</h3><p>Since I started to write tests and use test-driven development I can''t to develop another way. Tests helps me to write only necessary code and be sure that the code is working right. It''s a very useful skill for me. When I code on PHP I use the PhpUnit and Mockery, on JavaScript - mocha and sinon.</p><p><br></p><p>I follow the SOLID and DRY. I''m sure that I don''t need to use OOP in each case. I can use functional programming or OOP when it fits better.</p><p>It''s better to learn the language instead the framework. And I think that the developer should to choose the right tool for the specific task.</p>','2019-07-08 16:48:26','2019-07-08 16:48:26',1,'_',0,NULL,1,'Full Stack Web developer, php, js, nodejs, react, redux, sagas server-side rendering ',1);
